import logo from './logo.svg';
import './App.css';
import 'bulma/css/bulma.min.css';

function App() {
  return (
    <div className="section">
      <div className="container">
        <div className="columns">
          <div className="column">
            <p>Hello</p>
            <button></button>
          </div>
          <div className="column">
            <div className="columns">
              <div className="column">
                <p>Hi</p>
              </div>
              <div className="column">
                <button></button>
              </div>
            </div>
          </div>

        </div>
      </div>
    </div>
  );
}

export default App;
